// server.js
const express = require('express');
const nodeMailer = require('nodemailer');
const app = express();
const port = 3000;

app.use(express.json());

const html = `
    <h1>Hello!</h1>
    <p>This email is for you to reset your password. Thanks!</p>
`;

app.post('/send-email', async (req, res) => {
    try {
        const transporter = nodeMailer.createTransport({
            host: "mail.openjavascript.info",
            port: 465,
            secure: true,
            auth: {
                user: "test@openjavascript.info",
                pass: "NodeMailer123!",
            }
        });

        const info = await transporter.sendMail({
            from: 'OpenJavaScript <test@javascript.info>',
            to: 'carasim80@gmail.com', // assuming you pass the email address through the request body
            subject: 'Testing, testing, 123',
            html: html,
        });

        console.log("Message sent" + info.messageId);
        res.status(200).send('Email sent successfully');
    } catch (error) {
        console.error(error);
        res.status(500).send('Error sending email');
    }
});

app.listen(port, () => {
    console.log(`Server is running on port ${port}`);
});

function viewResources() {
    var response = '';
    var request = new XMLHttpRequest();
    request.open('GET', '/view-resources', true);
    request.setRequestHeader('Content-Type', 'application/json');
    request.onload = function () {
        response = JSON.parse(request.responseText);
        var html = ''
        for (var i = 0; i < response.length; i++) {
            html += '<tr>' +
                '<td>' + (i + 1) + '</td>' +
                '<td>' + response[i].name + '</td>' +
                '<td>' + response[i].location + '</td>' +
                '<td>' + response[i].description + '</td>' +
                '<td>' + response[i].owner + '</td>' +

                '<td>' + response[i].rating + '</td>' +
                '<td>' +
                '<button type="button" class="btn btn-warning" onclick="editResource(\'' + JSON.stringify(response[i]).replaceAll('\"', '&quot;') + '\')">Edit </button> ' +
                '<button type="button" class="btn btn-danger"  onclick="deleteResource(' + response[i].id + ')"> Delete</button>' +
                '</td>' +
                '</tr>'
        }
        document.getElementById('tableContent').innerHTML = html;

    };
    request.send();
}



