function deleteResource(selectedId) {
    var response = "";
    var request = new XMLHttpRequest();
    request.open("DELETE", "/delete-resource/" + selectedId, true);
    request.setRequestHeader('Content-Type', 'application/json');
    request.onload = function () {
        response = JSON.parse(request.responseText);
        if (response.message == "Resource deleted successfully!") {
            window.location.href = 'home.html';
            alert("Resource delete successfully")
        }
        else {
            alert('Unable to delete resource!');
        }
    };
    request.send();
}

function login() {
    var response = "";
    var jsonData = new Object();
    jsonData.email = document.getElementById("email").value;
    jsonData.password = document.getElementById("password").value;
    if (jsonData.email == "" || jsonData.password == "") {
        document.getElementById("error").innerHTML = 'All fields are required!';
        return;
    }
    var request = new XMLHttpRequest();
    request.open("POST", "/login", true);
    request.setRequestHeader('Content-Type', 'application/json');
    request.onload = function () {
        response = JSON.parse(request.responseText);
        console.log(response)
        if (response.message == "Login successful!") {
            sessionStorage.setItem("email", jsonData.email);
            window.location.href = 'home.html';
        }
        else {
            document.getElementById("error").innerHTML = 'Invalid credentials!';
        }
    };
    request.send(JSON.stringify(jsonData));
}

function logout() {
    sessionStorage.removeItem("email");

    // redirects the user to the login page after logout

    window.location.href = 'login.html'; 
}

function register() {
    var response = "";
    var jsonData = new Object();
    jsonData.email = document.getElementById("email").value;
    jsonData.password = document.getElementById("password").value;
    var confirmPassword = document.getElementById("confirmPassword").value;
    if (jsonData.email == "" || jsonData.password == "" || confirmPassword == "") {
        document.getElementById("error").innerHTML = 'All fields are required!';
        return;
    }
    else if (jsonData.password != confirmPassword) {
        document.getElementById("error").innerHTML = 'Password does not match!';
        return;
    }
    var request = new XMLHttpRequest();
    request.open("POST", "/register", true);
    request.setRequestHeader('Content-Type', 'application/json');
    request.onload = function () {
        response = JSON.parse(request.responseText);
        console.log(response)
        if (response.message == undefined) {
            window.location.href = 'index.html';
        }
        else {
            document.getElementById("error").innerHTML = 'Authentication failed!';
        }
    };
    request.send(JSON.stringify(jsonData));
}
